Styles:
     .PDFElement{
        border:1px solid transparent;
     }

     .PDFElement.Text{
        text-align:left;
     }

     .PDFElement p{
        line-height:14px;
        font-size:14px;
        margin:0;
        padding:0;

     }

     .PDFElement.Field{
        text-align:left;
     }

     .PDFElement.Field .FieldLabel{
        font-weight:bold;    
        vertical-align:top;            
     }

     .PDFElement.Field Table{
        width:100%;
     }

     .PDFElement.Field .FieldLabel .Top{              
        margin-bottom:2px;
     }
     .PDFElement.Field .FieldLabel .Bottom{              
        margin-top:2px;
     }
     .PDFElement.Field .FieldLabel .Left{              
        margin-right:2px;
     }
     .PDFElement.Field .FieldLabel .Right{              
        margin-left:2px;
     }


.pdfField_1 .FieldLabel,.pdfField_1 .FieldValue{text-align:left !important;padding:10px !important;background-color:#ffffff !important;}.pdfField_1 .FieldLabel{font-weight:bold !important;background-color:#ecf3fb !important;}.pdfField_1 .SummaryTable{border:1px #dfdfdf solid !important;}.pdfField_1 table{width:100% !important;}
